'use strict';

var React = require("react");
var DomUtils = require("../shared/utils/DomUtils.bs.js");
var ReactDOMRe = require("reason-react/src/ReactDOMRe.js");
var Json_decode = require("@glennsl/bs-json/src/Json_decode.bs.js");
var UserSessionNew = require("../users/UserSessionNew.bs.js");

function decodeProps(json) {
  return /* tuple */[
          Json_decode.field("schoolName", Json_decode.string, json),
          Json_decode.field("authenticityToken", Json_decode.string, json),
          Json_decode.field("fqdn", Json_decode.string, json),
          Json_decode.optional((function (param) {
                  return Json_decode.field("oauthHost", Json_decode.string, param);
                }), json)
        ];
}

var match = decodeProps(DomUtils.parseJSONTag("user-session-new-data", /* () */0));

var oauthHost = match[3];

var fqdn = match[2];

var authenticityToken = match[1];

var schoolName = match[0];

ReactDOMRe.renderToElementWithId(React.createElement(UserSessionNew.make, {
          schoolName: schoolName,
          authenticityToken: authenticityToken,
          fqdn: fqdn,
          oauthHost: oauthHost
        }), "user-session-new");

exports.decodeProps = decodeProps;
exports.schoolName = schoolName;
exports.authenticityToken = authenticityToken;
exports.fqdn = fqdn;
exports.oauthHost = oauthHost;
